const firebaseConfig = {
    apiKey: 'YOUR_API_KEY',
    authDomain: 'YOUR_AUTH_DOMAIN',
    projectId: 'YOUR_PROJECT_ID',
    storageBucket: 'YOUR_STORAGE_BUCKET',
    messagingSenderId: 'YOUR_MESSAGING_SENDER_ID',
    appId: 'YOUR_APP_ID',
  };

  export default firebaseConfig;

// Go to Firebase Console: Open the Firebase Console and sign in with your Google account. Create a Project: If you don't have an existing project, click on the "Add project" button to create a new one. Follow the prompts to set up your project. Add a Web App: After creating your project, click on "Add app" and choose the web platform (</> icon). Register the App: Give your app a nickname and register it. You can choose to set up Firebase Hosting, but it's optional for now. Get the Configuration: Once your app is registered, Firebase will provide you with the configuration snippet. //
